import java.util.PriorityQueue;
import java.util.Queue;

public class Main {
    public static void main(String[] args) {
        Queue<Integer> queue = new PriorityQueue<>();

        // Adding initial elements
        queue.add(3);
        queue.add(5);
        queue.add(7);
        queue.add(9);
        queue.add(11);


        boolean flag = Math.random() > 0.5;
        /* other operations */
        queue.poll(); // poll to make queue lose its head
        /* other operations */

        /* write */ queue.offer(2);

        if (flag) {
            queue.offer(4); // Misleading write
        }
        queue.poll(); // poll another head

        /* other operations */
        queue.offer(6); // adding element but not affecting the specific read point value


        queue.add(8); // Misleading write too
        queue.remove(11); // modified queue but not impacting queue structure


        /* read */ int ret = queue.peek();

        System.out.println("Retrieved value: " + ret);
    }
}
